import React from 'react';

class EmployeeDetail extends React.Component {
    render() {
        let { employees, onClickEmployee } = this.props;

        let employeeList = null;
        if (!!employees) {
            employeeList = employees.map((employee) => (
                <p>
                    <button key={employee.EmployeeID} onClick={() => onClickEmployee(employee.EmployeeID)}>
                    {employee.EmployeeNumber} {employee.FirstName} {employee.LastName}</button>
                </p>
            ));
        }
        return (
            <div>
                {employeeList}
            </div>
        );
    }
}

export { EmployeeDetail }
